import React from "react";

function SetMinus (props) {
  return (
    <div>
      <a type="button" onClick={props.onClick} className="BUTTON">Сменить статус</a>
      <WriteStatus status={props.status}/>
    </div>
  )
}

function WriteStatus (props) {
  return (
    <div>
      {props.status}
    </div>
  )
}

export default SetMinus
